import React from "react";
import { Jumbotron, Container} from "react-bootstrap";
import styles from "../CSS/Register.module.css";


export default function NotAccess() {
  return (
    <Jumbotron id="about" className={styles.Jumbotron} fluid>
      <Container>
          <div className={styles.cardForbbiden}>
            <h1 className={styles.heading}>
              <span className={styles.Us}>You Don't Have Acess! Need to <Link className={styles.categoryLink} to={"/login"}> Teste</Link></span>
            </h1>
          </div>
      </Container>
    </Jumbotron>
  );
}
